import React, {useState} from 'react';
import {Navbar, Nav, Container, Col, Image, Accordion} from 'react-bootstrap';

const Navigation = () => {
  const [logged, setLogged] = useState(true);
  const [isAdmin, setAdmin] = useState(true);
  return (
    <Navbar bg="dark" variant="dark">
      <Container>
        <Navbar.Brand>
            <Nav.Link href="/"><Image src="logo.png" width="50" rounded /></Nav.Link>
        ProjectUJ
        </Navbar.Brand>
        <Nav>
          {logged && <Nav.Link href="/projects">Projects</Nav.Link>}
          {logged && <Nav.Link href="/tasks">Tasks</Nav.Link>}
          {logged && isAdmin && <Nav.Link href="/users">Users</Nav.Link>}
            {logged && <Nav.Link href="/logout">Logout</Nav.Link>}
            <Accordion>
            <Accordion.Item  eventKey="0">
             <Accordion.Header>My Projects</Accordion.Header>

            <Accordion.Body>
              <Nav>
                <Nav.Link href="#section1">Section 1</Nav.Link>
                <Nav.Link href="#section2">Section 2</Nav.Link>
                <Nav.Link href="#section3">Section 3</Nav.Link>
              </Nav>
            </Accordion.Body>
              </Accordion.Item >
          </Accordion>
        </Nav>
      </Container>
    </Navbar>
  );
};

export default Navigation;
